import React, { useEffect, useState } from "react";
import { Text } from "react-native";

const Product = ({ product }) => {
  return (
    <>
      <TouchableOpacity
        style={{color:"green"}}
        onPress={() => {
          navigation.navigate("EditEngineers", { engineerId: engineer.id });
        }}
      >
        <Text>
          {product.name}
        </Text>
      </TouchableOpacity>
      <Text>{product.name}</Text>
      {console.log(product)}
    </>
  );
};

export default Product;
